import React from 'react';
import {Link} from 'react-router-dom'
import styled from 'styled-components';
import './Card.scss'

const Pais = styled.h2`
  text-align: center;
  font-size: 20px;
  color: rgb(49, 0, 0);
`;

const Continente = styled.h4`
  font-size: 17px;
  color: rgb(49, 0, 0);
`;

const Bandera = styled.img`
  border-radius: 5px;
  width: 210px;
  height: 120px;
`;

export default function Card({nameCountry, continent, flag,id}){
  return (
    <div className= "country">
      <Link to={`/Country/${id}`}><img className='Bandera' src={flag} alt="No existe bandera"/></Link>
      <h2>{nameCountry}</h2>
      <h>{continent}</h>
    </div>
  );
}
